1) ‘레알마드리드 : 맨시티’

 레알마드리드와 맨시티가 두 시즌 연속 UEFA 챔피언스리그(이하 UCL) 결승 진출을 두고 맞붙는다. 8강에서 레알마드리드는 첼시를 맨시티는 바이에른 뮌헨을 각각 제압하며 준결승에 올랐다. 지난 시즌 양 팀의 맞대결은 1차전에서 맨시티가 4대 3으로 승리했고 2차전에서도 맨시티가 선제골을 터뜨리며 승기를 잡았다. 하지만 2차전 종료 직전 터진 호드리구의 멀티골과 연장전에서 나온 카림 벤제마의 페널티킥 득점을 앞세워 레알마드리드가 합산 스코어 6대 5로 역전한 바 있다. 대회 역대 최다 우승팀인 레알마드리드가 또다시 결승으로 향할지, 엘링 홀란드를 영입하며 대권에 도전하는 맨시티가 복수에 성공할지 주목된다. 22-23 UCL 준결승 1차전 레알마드리드 대 맨시티 경기는 10일 수요일 새벽 4시 SPOTV NOW에서 독점 생중계된다.



2) ‘AC밀란 : 인터밀란’

 22-23 UCL 준결승에서 ‘밀란 형제’ AC밀란과 인터밀란이 만난다. 04-05 시즌 이후 18년 만에 UCL에서 만나게 된 두 팀은 세리에A에서도 5위와 4위에 위치해 치열한 순위 경쟁을 펼치고 있다. 인터밀란은 최근 5연승을 달리며 상승세를 탔고, AC밀란은 9경기 무패 행진을 기록 중이다. AC밀란의 마지막 UCL 우승은 16년 전인 06-07 시즌이고, 인터밀란은 09-10 시즌에 마지막 빅 이어를 들어올렸다. 두 팀은 이전까지 UCL 준결승에서 딱 한 차례 만난 바 있다. 02-03 UCL 준결승에서 맞붙었고 접전 끝에 AC밀란이 결승으로 향하며 우승에 성공했다. 22-23 UCL 준결승 1차전에서 펼쳐질 밀란 더비는 11일 목요일 새벽 4시 SPOTV NOW에서 만날 수 있다.',to_date('23/05/08','RR/MM/DD'));



